import React, { useState, useEffect, useRef } from 'react';
import io from 'socket.io-client';

const socket = io('http://localhost:5000');

function ChatBot() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const messagesEndRef = useRef(null);

  useEffect(() => {
    socket.on('bot message', (message) => {
      setMessages((prevMessages) => [...prevMessages, { type: 'bot', text: message }]);
    });

    socket.on('bot qr', (qrImageUrl) => {
      setMessages((prevMessages) => [...prevMessages, { type: 'qr', url: qrImageUrl }]);
    });

    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });

    return () => {
      socket.off('bot message');
      socket.off('bot qr');
    };
  }, []);

  useEffect(() => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages]);

  const sendMessage = (e) => {
    e.preventDefault();
    if (input.trim() === '') return;
    socket.emit('chat message', input);
    setMessages((prevMessages) => [...prevMessages, { type: 'user', text: input }]);
    setInput('');
  };

  return (
    <div style={styles.pageBackground}>
      <div style={styles.chatContainer}>
        <h2 style={styles.title}>🎟️ Museum Ticket Chatbot</h2>
        <div style={styles.messagesContainer}>
          {messages.map((msg, index) => (
            <div key={index} style={msg.type === 'bot' ? styles.botMessage : (msg.type === 'user' ? styles.userMessage : styles.qrMessage)}>
              {msg.type === 'qr' ? (
                <img src={msg.url} alt="QR Code" style={{ width: '150px', height: '150px' }} />
              ) : (
                msg.text
              )}
            </div>
          ))}
          <div ref={messagesEndRef} />
        </div>
        <form onSubmit={sendMessage} style={styles.inputForm}>
          <input
            type="text"
            placeholder="Type your message..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
            style={styles.inputBox}
          />
          <button type="submit" style={styles.sendButton}>Send</button>
        </form>
      </div>
    </div>
  );
}

const styles = {
  pageBackground: {
    backgroundColor: '#f0f2f5',
    height: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  chatContainer: {
    width: '400px',
    height: '600px',
    backgroundColor: '#ffffff',
    borderRadius: '20px',
    display: 'flex',
    flexDirection: 'column',
    overflow: 'hidden',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
  },
  title: {
    textAlign: 'center',
    padding: '15px',
    backgroundColor: '#4caf50',
    color: 'white',
    margin: 0,
    fontSize: '20px',
  },
  messagesContainer: {
    flex: 1,
    overflowY: 'auto',
    padding: '10px',
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#f9f9f9',
  },
  botMessage: {
    backgroundColor: '#e0f7fa',
    alignSelf: 'flex-start',
    padding: '10px',
    borderRadius: '10px',
    marginBottom: '8px',
    maxWidth: '80%',
    fontSize: '15px',
  },
  userMessage: {
    backgroundColor: '#c8e6c9',
    alignSelf: 'flex-end',
    padding: '10px',
    borderRadius: '10px',
    marginBottom: '8px',
    maxWidth: '80%',
    fontSize: '15px',
  },
  qrMessage: {
    alignSelf: 'center',
    margin: '10px 0',
  },
  inputForm: {
    display: 'flex',
    padding: '10px',
    backgroundColor: '#ffffff',
  },
  inputBox: {
    flex: 1,
    padding: '10px',
    fontSize: '16px',
    borderRadius: '20px',
    border: '1px solid #ccc',
    marginRight: '10px',
    outline: 'none',
  },
  sendButton: {
    padding: '10px 20px',
    fontSize: '16px',
    borderRadius: '20px',
    border: 'none',
    backgroundColor: '#4caf50',
    color: 'white',
    cursor: 'pointer',
  },
};

export default ChatBot;
